export default function LocationDropdown(props){
    const [allDropdownElements, setAllDropdownElements] = new State([])
    props.listOfLoc.map(() =>{
        <p>{props.listOfLoc[0]}</p>
    })

    return(
        <div className="location-dropdown-element">
            {allDropdownElements}
        </div>
    )
}
